    <title>Styczynski Jupyter</title>
    <script type="text/javascript">
      function getNewLocation(l) {
        segmentCount = 0;
        return (
            l.protocol +
            '//' +
            l.hostname +
            (l.port ? ':' + l.port : '') +
            l.pathname
        );
      }
      window.location.replace(getNewLocation(window.location));
    </script>
